import React, { Component } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../Register/RegisterPage.css';
import Navigation from '../Navigation/NavigationPage';
import Footer from '../Footer/FooterPage';

function withNavigate(Component) {
  return props => <Component {...props} navigate={useNavigate()} />;
}

class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userType: 'farmer', // Initialize userType in the state
      username: '',
      password: '',
      confirmPassword: '',
      farmerName: '',
      email: '',
      phone: '',
      farmerAddress: '',
      farmerId: '',
      farmerLicense: null,
      farmLocationAddress: '',
      error: '',
      usernameExistsError: '',
      emailExistsError: '',
      phoneExistsError: ''
    };
  }

  handleChange = (e) => {
    if (e.target.name === 'userType') {
      this.setState({ userType: e.target.value }); // Update userType in state
    } else {
      this.setState({ [e.target.name]: e.target.value });
    }
  };

  handleFileChange = (e) => {
    this.setState({ farmerLicense: e.target.files[0] });
  };

  handleSubmit = async (e) => {
    e.preventDefault();
    const {
      userType,
      username,
      password,
      confirmPassword,
      farmerName,
      email,
      phone,
      farmerAddress,
      farmerId,
      farmerLicense,
      farmLocationAddress
    } = this.state;
    const { navigate } = this.props;

    if (password !== confirmPassword) {
      this.setState({ error: 'Passwords do not match' });
      return;
    }

    try {
      const formData = new FormData();
      formData.append('userType', userType);
      formData.append('username', username);
      formData.append('password', password);
      formData.append('farmerName', farmerName);
      formData.append('email', email);
      formData.append('phone', phone);
      formData.append('farmerAddress', farmerAddress);
      formData.append('farmerId', farmerId);
      formData.append('farmerLicense', farmerLicense); // Ensure farmer license file is appended
      formData.append('farmLocationAddress', farmLocationAddress);

      const response = await fetch('http://localhost:3000/register', {
        method: 'POST',
        body: formData
      });

      if (response.ok) {
        const responseData = await response.json();
        console.log('Registration successful:', responseData);
        this.setState({
          error: '',
          usernameExistsError: '',
          emailExistsError: '',
          phoneExistsError: ''
        });
        alert('Registration successful');
        navigate('/login');
      } else {
        const errorData = await response.json();
        console.error('Registration failed:', errorData);
        this.setState({ error: 'Registration failed' });

        // Check for specific error messages from the server
        if (errorData.message.includes('Username')) {
          this.setState({ usernameExistsError: errorData.message });
        }
        if (errorData.message.includes('Email')) {
          this.setState({ emailExistsError: errorData.message });
        }
        if (errorData.message.includes('Phone Number')) {
          this.setState({ phoneExistsError: errorData.message });
        }
      }
    } catch (error) {
      console.error('Error during registration:', error);
      this.setState({ error: 'Error during registration' });
    }
  };

  render() {
    const {
      username,
      password,
      confirmPassword,
      farmerName,
      email,
      phone,
      farmerAddress,
      farmerId,
      farmLocationAddress,
      error,
      usernameExistsError,
      emailExistsError,
      phoneExistsError,
      userType // Ensure userType is included in component's state
    } = this.state;

    return (
      <div>
        <Navigation />
        <div className="register-page">
          <div className="register-form">
            <h2>Register</h2>
            <form onSubmit={this.handleSubmit}>
              <div className="form-group">
                <label>User Type</label>
                <select name="userType" value={userType} onChange={this.handleChange}>
                  <option value="farmer">Farmer</option>
                  <option value="customer">Customer</option>
                  <option value="worker">Worker</option>
                </select>
              </div>
              <div className="form-group">
                <label>Username</label>
                <input type="text" name="username" value={username} onChange={this.handleChange} />
                <span className="error">{usernameExistsError}</span>
              </div>
              <div className="form-group">
                <label>Password</label>
                <input type="password" name="password" value={password} onChange={this.handleChange} />
              </div>
              <div className="form-group">
                <label>Confirm Password</label>
                <input type="password" name="confirmPassword" value={confirmPassword} onChange={this.handleChange} />
              </div>
              <div className="form-group">
                <label>Email</label>
                <input type="email" name="email" value={email} onChange={this.handleChange} />
                <span className="error">{emailExistsError}</span>
              </div>
              <div className="form-group">
                <label>Phone</label>
                <input type="tel" name="phone" value={phone} onChange={this.handleChange} />
                <span className="error">{phoneExistsError}</span>
              </div>
              {userType === 'farmer' && (
                <>
                  <div className="form-group">
                    <label>Farmer Name</label>
                    <input type="text" name="farmerName" value={farmerName} onChange={this.handleChange} />
                  </div>
                  <div className="form-group">
                    <label>Farmer Address</label>
                    <input type="text" name="farmerAddress" value={farmerAddress} onChange={this.handleChange} />
                  </div>
                  <div className="form-group">
                    <label>Farmer ID</label>
                    <input type="text" name="farmerId" value={farmerId} onChange={this.handleChange} />
                  </div>
                  <div className="form-group">
                    <label>Farmer License</label>
                    <input type="file" name="farmerLicense" onChange={this.handleFileChange} />
                  </div>
                  <div className="form-group">
                    <label>Farm Location Address</label>
                    <input type="text" name="farmLocationAddress" value={farmLocationAddress} onChange={this.handleChange} />
                  </div>
                </>
              )}
              <div className="form-group">
                <button type="submit">Register</button>
              </div>
              <span className="error">{error}</span>
            </form>
            <p>Already have an account? <Link to="/login">Login here</Link></p>
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}

export default withNavigate(Register);
